import data from "./data";

function App() {
  return (
    <div className="App">
      <header>
        <a href="/">Amazona</a>
      </header>
      <main>
        <h1>
          Featured products
          {
            data.products.map(product=>(
              <div key ={product.slug}>
                <img src={product.image} alt={product.image} />
                <p>
                {product.price}
                </p>


              </div>
            ))

          }
        </h1>
      </main>
    </div>
  );
}

export default App;
